  return(
    <body className="background">
      <div className="landingPage">
        <h1 className="tagline"><div>A BETTER BODY.</div><div>SIMPLIFIED.</div></h1>
        <div className="info">Workout Pal keeps track of your progress so you don't have to.</div>
        <div className="info">Log workouts with ease with our comprehensive list of built-in exercises.</div>
        <button class="linkButton"><Link to="/home">Get Started</Link></button>
      </div>
    </body>
  )

}
